import React from 'react'
import articles from './articlecontent'

const ArticlesList = () => {
    return (
    <>
        {articles.map(article => (
            <div>
                <h1 key={article.slug}>{article.title}</h1>
            </div>
        ))
    }
    </>
    )
}

export default ArticlesList
